import React from "react";
import CaseList from "../Components/CaseList/CaseList";

class App extends React.Component {
  render() {
    return (
      <>
        <div className='index'>
          <CaseList />
        </div>
        <style jsx>
          {`
            .index {
              background-image: url("/images/csgomenubg.jpg");
              width: 100vw;
              height: 100vh;
              background-size: cover;
              background-repeat: no-repeat;
            }
          `}
        </style>
      </>
    );
  }
}

export default App;
